import React from 'react';
import { Link } from 'react-router-dom';
import Breadcrumb from 'react-bootstrap/Breadcrumb';
import './Nav.css';

const Nav = () => {
  return (
    <nav>
      <div className="logo">
        <h4>Logo</h4> 
      </div>
      <div className="name">
        <h4>Name</h4>
      </div>
    </nav>
  )
}

export default Nav;
